import React from "react";
import { Text, Button, Stack, IconButton, Heading } from "@chakra-ui/react";

export default function Menu(props) {
    return (
        <Stack direction="row" spacing={10} backgroundColor="gray.900">
            <Heading color="white" size="md" m="2" >
                TorrPydo
            </Heading>
            <Button colorScheme="blue" variant="solid">
                Add
            </Button>
            <Button colorScheme="blue" variant="solid">
                Manage
            </Button>

        </Stack>
  );
}
